import React,  {Fragment} from 'react'

let msg;
export const Home = ()=> {
    if (localStorage.getItem('access_token') == null){
        msg = "You're not logged in."
    }
    return(
        <Fragment>
            <div className="container mt-3">
                <h1>Home page</h1>
                <p>{this.msg}</p>
            </div>
        </Fragment>
    )
}
